  return Promise.allSettled([signUpUser(firstName, lastName), uploadPhoto(fileName)])
    .then((result) => (result.map((p) => ({
      status: p.status,
      value: p.status === 'fulfilled' ? p.value : String(p.reason),
    }))));
}

